INSERT INTO `tpyjd_kbarticle` VALUES ('035-66856e9e-422e-47c2-9734-2716af593ea6', '净资产都包括那些？', '004-e3f9c914-ca4d-475b-9a9d-5b136d17da4f', 'KB-20110615-0029', '净资产', 'NULL', '净资产是指申请人及其配偶和子女名下的全部资产减去负债以后的净额。其中，资产包括动产和不动产，例如存款、股票、债券、期货、所购保险、房产。此外，净资产还包括申请人拥有的公司净资产。', 'NULL', 'NULL', '030-000000000000000000000000000000000000', '027-000000000000000000000000000000000000', '20:42.1', '027-000000000000000000000000000000000000', '20:42.2', '027-000000000000000000000000000000000000', '2', '2000', 'NULL', '0', 'NULL', 'NULL');
INSERT INTO `tpyjd_kbarticle` VALUES ('035-68190cb7-8d76-40c0-ae5c-bfe4a487139b', '我没有缴过所得税，办投资移民一定要提供所得税税票吗？税务局开的纳税证明可不可以？', '004-e3f9c914-ca4d-475b-9a9d-5b136d17da4f', 'KB-20110615-0024', '纳税', 'NULL', '签证官不关心您是否纳税，他关心申请人是否有足够的资产和合理的来源解释。在中国，不是所有的收入都要上缴个人所得税，因此，所得税的问题既不是移民申请成功的充分条件，更不是一个必要条件。', 'NULL', 'NULL', '030-000000000000000000000000000000000000', '027-000000000000000000000000000000000000', '20:42.0', '027-000000000000000000000000000000000000', '20:42.0', '027-000000000000000000000000000000000000', '2', '2000', 'NULL', '0', 'NULL', 'NULL');
